import { useDispatch, useSelector } from "react-redux"
import {  Addprod, GetAll } from "./actios/acionprodact";
import { useEffect } from "react";
export default function Prodact(){
const prodact1=useSelector((state)=>state.prodact);
const dispatch=useDispatch()
useEffect(()=>{
dispatch(GetAll())
},[])

return(
<div>
<button onClick={()=>dispatch(Addprod({id:30,title:"abfd"}))}>Add Pordact</button>
{prodact1.map((pro)=>(
<p key={pro.id }>{pro.title}</p>
))}
</div>
)
}
